import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';

import Home from './Components/Home/home';
import Login from "./Components/Login/login";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route exact path='/' element={<Home/>}/>
                <Route exact path="login" element={<Login/>}/>
                <Route exact path/>
            </Routes>
        </BrowserRouter>
    );
}

export default App;
